                }
                else {
                    $(""#p1"").html(""Ne postoje proizvode izabrane kategorije"");
                }
            });

            zahtjev.fail(function (gr) {
                $(""#p1"").html(gr.statusText);
            });
        }

        $(function () {
            PrikaziProizvode(0);

            $(""#Select1"").change(function () {
                var id = $(""#Select1"").val();

                PrikaziProizvode(id);
            });
        });
    </script>
